import React, { useState } from "react";
import { TextField, Button, Container, Typography } from "@mui/material";

export default function Login({ onLogin }) {
  const [username, setUsername] = useState("");
  const [password, setPassword] = useState("");

  const handleSubmit = () => {
    if (username === " brand@birdvision.com" && password === "1234") {
      localStorage.setItem("token", "mock-jwt-token");
      onLogin();
    } else {
      alert("Invalid credentials");
    }
  };

  return (
    <Container maxWidth="xs" className="mt-40 shadow-lg p-6 bg-white rounded">
      <Typography variant="h5" className="text-center mb-4">Login</Typography>
      <TextField label="Username" fullWidth margin="normal" onChange={(e) => setUsername(e.target.value)} />
      <TextField label="Password" type="password" fullWidth margin="normal" onChange={(e) => setPassword(e.target.value)} />
      <Button fullWidth variant="contained" onClick={handleSubmit}>Login</Button>
    </Container>
  );
}
